    private boolean isChinese(String str) {
        Pattern p = Pattern.compile("[\u4e00-\u9fa5]");
        Matcher m = p.matcher(str);
        if (m.find()) {
            return true;
        } else {
            return false;
        }
    }

    private void CHOOSE_PHOTO() {
        {
            //如果没有权限则申请权限
            if (ContextCompat.checkSelfPermission(USBESCPrintActivity.this, Manifest.permission.WRITE_EXTERNAL_STORAGE) != PackageManager.PERMISSION_GRANTED) {
                ActivityCompat.requestPermissions(USBESCPrintActivity.this, new String[]{Manifest.permission.WRITE_EXTERNAL_STORAGE}, 1);
            }
            //调用打开相册
            openAlbum();
        }
    }

    private void openAlbum() {
        Intent intent = new Intent("android.intent.action.GET_CONTENT");
        intent.setType("image/*");
        startActivityForResult(intent, CHOOSE_PHOTO); // 打开相册
    }

    @Override
    protected void onActivityResult(int requestCode, int resultCode, Intent data) {
        super.onActivityResult(requestCode, resultCode, data);
        switch (requestCode) {
            case 1:
                if (data != null) {
                    // 判断手机系统版本号
                    if (Build.VERSION.SDK_INT >= 19) {
                        // 4.4及以上系统使用这个方法处理图片
                        try {
                            handleImageOnKitKat(data);
                        } catch (IOException e) {
                            e.printStackTrace();
                        }
                    } else {
                        // 4.4以下系统使用这个方法处理图片
                        try {
                            handleImageBeforeKitKat(data);
                        } catch (IOException e) {
                            e.printStackTrace();
                        }
                    }

                } else {//防止用户未从媒体库选择图片返回
                    textView = "未选择图片";
                    if (toast != null) {
                        toast.cancel();
                    }
                    toast = Toast.makeText(USBESCPrintActivity.this, textView, Toast.LENGTH_SHORT);
                    toast.show();
                }
                break;
            case 2:

                break;

        }

    }

    @Override
    public void onRequestPermissionsResult(int requestCode, String[] permissions, int[] grantResults) {
        super.onRequestPermissionsResult(requestCode, permissions, grantResults);
        switch (requestCode) {
            case 1:
                if (grantResults.length > 0 && grantResults[0] == PackageManager.PERMISSION_GRANTED) {
                    openAlbum();
                } else {
                    Toast.makeText(this, R.string.permission, Toast.LENGTH_SHORT).show();
                }
                break;
        }
    }

    @TargetApi(19)
    private void handleImageOnKitKat(Intent data) throws IOException {
        String imagePath = null;
        Uri uri = data.getData();
        uri = getUri(uri);//区分uri
//        Uri uri = Uri.parse(data.toString());
        Log.d("TAG", "handleImageOnKitKat: uri is " + uri);
        if (DocumentsContract.isDocumentUri(this, uri)) {
            // 如果是document类型的Uri，则通过document id处理
            String docId = DocumentsContract.getDocumentId(uri);
            if ("com.android.providers.media.documents".equals(uri.getAuthority())) {
                String id = docId.split(":")[1]; // 解析出数字格式的id
                String selection = MediaStore.Images.Media._ID + "=" + id;
                imagePath = getImagePath(MediaStore.Images.Media.EXTERNAL_CONTENT_URI, selection);
//                imagePath = getImagePath2(this,MediaStore.Images.Media.EXTERNAL_CONTENT_URI);

            } else if ("com.android.providers.downloads.documents".equals(uri.getAuthority())) {
                Uri contentUri = ContentUris.withAppendedId(Uri.parse("content://downloads/public_downloads"), Long.valueOf(docId));
                imagePath = getImagePath(contentUri, null);
//                imagePath = getImagePath2(this,contentUri);
            }
        } else if ("content".equalsIgnoreCase(uri.getScheme())) {
            // 如果是content类型的Uri，则使用普通方式处理
//            imagePath = getImagePath(uri, null);
            imagePath = getFilePathForN(this, uri);
        } else if ("file".equalsIgnoreCase(uri.getScheme())) {
            // 如果是file类型的Uri，直接获取图片路径即可
            imagePath = uri.getPath();
        }
        if (imagePath != null) {
            displayImage(imagePath); // 根据图片路径打印图片
        } else {
            textView = getString(R.string.filePathNull);
            if (toast != null) {
                toast.cancel();
            }
            toast = Toast.makeText(USBESCPrintActivity.this, textView, Toast.LENGTH_SHORT);
            toast.show();
        }
    }

    private void handleImageBeforeKitKat(Intent data) throws IOException {
        Uri uri = data.getData();
        String imagePath = getImagePath(uri, null);
        displayImage(imagePath);// 根据图片路径打印图片
    }

    private Uri getUri(Uri uri) {
        String path = uri.getEncodedPath();
        if (path != null) {
            path = Uri.decode(path);
            ContentResolver cr = this.getContentResolver();
            StringBuffer buff = new StringBuffer();
            buff.append("(")
                    .append(MediaStore.Images.ImageColumns.DATA)
                    .append("=")
                    .append("'" + path + "'")
                    .append(")");
            Cursor cur = cr.query(
                    MediaStore.Images.Media.EXTERNAL_CONTENT_URI,
                    new String[]{MediaStore.Images.ImageColumns._ID},
                    buff.toString(), null, null);
            int index = 0;
            for (cur.moveToFirst(); !cur.isAfterLast(); cur
                    .moveToNext()) {
                index = cur.getColumnIndex(MediaStore.Images.ImageColumns._ID);
                index = cur.getInt(index);
            }
            if (index == 0) {
            } else {
                Uri uri_temp = Uri
                        .parse("content://media/external/images/media/"
                                + index);
                if (uri_temp != null) {
                    uri = uri_temp;
                }
            }
        }
        return uri;
    }

    private String getImagePath(Uri uri, String selection) {
        String path = null;
        // 通过Uri和selection来获取真实的图片路径
        Cursor cursor = getContentResolver().query(uri, null, selection, null, null);
        if (cursor != null) {
            if (cursor.moveToFirst()) {
                Log.i("media", MediaStore.Images.Media.DATA);
                path = cursor.getString(cursor.getColumnIndex(MediaStore.Images.Media.DATA));
            }
            cursor.close();
        }
        return path;
    }

    private static String getFilePathForN(Context context, Uri uri) {
        try {
            Cursor returnCursor = context.getContentResolver().query(uri, null, null, null, null);
            int nameIndex = returnCursor.getColumnIndex(OpenableColumns.DISPLAY_NAME);
            returnCursor.moveToFirst();
            String name = (returnCursor.getString(nameIndex));
            File file = new File(context.getFilesDir(), name);
            InputStream inputStream = context.getContentResolver().openInputStream(uri);
            FileOutputStream outputStream = new FileOutputStream(file);
            int read = 0;
            int maxBufferSize = 1 * 1024 * 1024;
            int bytesAvailable = inputStream.available();
            int bufferSize = Math.min(bytesAvailable, maxBufferSize);
            final byte[] buffers = new byte[bufferSize];
            while ((read = inputStream.read(buffers)) != -1) {
                outputStream.write(buffers, 0, read);
            }
            returnCursor.close();
            inputStream.close();
            outputStream.close();
            return file.getPath();
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }


    // 根据图片路径打印图片
    private void displayImage(String imagePath) throws IOException {
        if (imagePath != null) {
            bitmap = BitmapFactory.decodeFile(imagePath);//获得选取的照片
            Bitmap printbitmap = compressPic(bitmap);//去除图片透明度
            String width = bitmapwidth.getText().toString();
            String mode = bitmapmode.getText().toString();
            String align = bitmapalign.getText().toString();
            if (width.equals("")) {
                width = "384";
            }
            if (mode.equals("")) {
                mode = "0";
            }
            if (align.equals("")) {
                align = "0";
            }

            Esc esc = new Esc();
            esc.reset();
            esc.align(Integer.valueOf(align));
            esc.printBitmapHorizontal(printbitmap, Integer.valueOf(width), Integer.valueOf(mode));
            esc.reset();
//            esc.formfeedY(6);
//            esc.printAdvance();
//            esc.cutAll();
            USBUtil.getInstance().CommandEsc(esc);
            esc.clear();
        } else {
            textView = "未获取图片";
            if (toast != null) {
                toast.cancel();
            }
            toast = Toast.makeText(USBESCPrintActivity.this, textView, Toast.LENGTH_SHORT);
            toast.show();
        }
    }

    /**
     * 对图片进行压缩（去除透明度）
     *
     * @param
     */
    public static Bitmap compressPic(Bitmap bitmap) {
        // 获取这个图片的宽和高
        int width = bitmap.getWidth();
        int height = bitmap.getHeight();
        int newWidth;
        // 指定调整后的宽度和高度
        if (width >= 380) {
            newWidth = 380;
        } else {
            newWidth = width;
        }
        int newHeight = newWidth * height / width;
        Bitmap targetBmp = Bitmap.createBitmap(newWidth, newHeight, Bitmap.Config.ARGB_8888);
        Canvas targetCanvas = new Canvas(targetBmp);
        targetCanvas.drawColor(0xffffffff);
        targetCanvas.drawBitmap(bitmap, new Rect(0, 0, width, height), new Rect(0, 0, newWidth, newHeight), null);
        return targetBmp;
    }


